  \"Dynamic Stall Flow Control Through the Use of a Novel Plasma Based Actuator Technology
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 6,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-06T22:33:47.981432\",\n\t\"name\":
  \"dynamic-stall-flow-control-through-the-use-of-a-novel-plasma-based-actuator-technology-pro\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Lynntech proposes a novel flow control methodology
  for airfoils undergoing dynamic stall. Dynamic stall refers to an aerodynamic phenomenon
  that is experienced by airfoils that undergo rapid changes in the flow angle of
  attack such as rotorcraft based airfoils, flapping wing technologies as well as
  fixed wing aircrafts undergoing sudden angle of attack changes. Dynamic stall is
  inherently an unsteady, non linear and complicated effect that can affect such flight
  parameters as lift, drag and airfoil stability. rnLynntech, along with its STTR
  partner in Dr. Noel Clemens and Dr. Jayant Sirohi, at the University of Texas at
  Austin proposes to use novel pulsed plasma discharge based actuators for flow control
  on dynamically stalled airfoils. Lynntech has more than 20 years of experience with
  applied plasma physics and 10 years of experience with turbulent CFD modeling. Dr.
  Noel Clemens at the University of Texas Flow Imaging Research Laboratory in the
  Department of Aerospace Engineering, who has implemented and tested various types
  of plasma actuators for flow control. rnThe proposed technology consists of pulsed
  plasma actuators which will induce high velocity airflow within the airfoil boundary
  layer, thus reattaching the flow. The proposed plasma actuator can achieve high
  Reynolds number (&gt;5e6) flow control compared to contemporary dielectric barrier
  discharge plasma actuators without relying  on corona discharge / hot plasma technology.
  Advantages of the system include low power consumption, ease of installation, increased
  flight stability, reduced drag and higher stall angles.\",\n\t\"license_title\":
